import { useState } from "react";
import Button from "react-bootstrap/Button";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row"; // Importer Row depuis react-bootstrap

export const Admin = () => {
  // Vos hooks useState et fonctions ici...

  return (
    <div>
      <Row>
        <Col>
          <Button onClick={handleOpenAdminManagement} className="mb-2">
            Manager les comptes admins
          </Button>
          <Button onClick={handleOpenVehicleManagement} className="mb-2">
            Manager les véhicules
          </Button>
          <Button onClick={handleOpenVehicleRelatedManagement} className="mb-2">
            Manager les données des véhicules
          </Button>
          <Button onClick={handleOpenRequestManagement} className="mb-2">
            Manager les demandes
          </Button>
          <Button onClick={handleOpenTestimonyManagement} className="mb-2">
            Manager les commentaires
          </Button>
        </Col>
      </Row>
    </div>
  );
};
